class IssueReport:
    def __init__(self, user_id, description):
        self.user_id = user_id
        self.description = description

class Developer:
    def log_issue(self, issue):
        print(f"Issue logged: {issue.description} by User: {issue.user_id}")

    def update_validation_rules(self, rules):
        self.validation_rules = rules
        print("Validation rules updated.")

class Broker:
    def __init__(self):
        self.submissions = []

    def process_deletions(self, date):
        self.submissions = [s for s in self.submissions if s.date != date]
        print(f"Processed deletions for date: {date}")

    def generate_d1_file(self):
        # Simulating D1 file generation
        return "D1 file generated and synced with FPDS data."

    def prevent_double_submissions(self, submission):
        for s in self.submissions:
            if s.user_id == submission.user_id and s.file_path == submission.file_path:
                raise Exception("Double submission detected.")
        self.submissions.append(submission)
        print("Submission recorded.")

